import { useState } from "react";
import data from "../data.js";

function Main (props){

    let [test, setTest] = useState(data);
    
    return(
    <div>
    <h1>심리테스트</h1>
    {
    data.map(function(test , i){
        return(
            <h4> {test.text} 
            {test.answer[i]}</h4>
        )
    }
        )}
    </div>
    )
}

export default Main;
